({
	doInit: function(component, event, helper) {
		helper.component = component;

		const link = document.createElement('a');
		const base64Data = "";
		link.href = `data:application/octet-stream;base64,${base64Data}`;
		link.setAttribute('download', "Disclaimer.pdf");
		document.body.appendChild(link);
		link.click();
		document.body.removeChild(link);

		const dismissActionPanel = $A.get("e.force:closeQuickAction");
		dismissActionPanel.fire();
	},
	generatePdf : function(component, event, helper) {
		return;

		try {
			window.jsPDF = window.jspdf.jsPDF;
			// Create a new jsPDF instance
			const doc = new jsPDF({lineHeight: 1.25});
			// const offsetCenter =  doc.internal.pageSize.width / 2;

			doc.addFileToVFS("Sarabun-Regular.ttf", font.Sarabun);
			doc.addFont("Sarabun-Regular.ttf", "Sarabun", "normal");

			doc.addFileToVFS("Sarabun-Bold.ttf", font.SarabunBold);
			doc.addFont("Sarabun-Bold.ttf", "Sarabun", "bold");

			// doc.addFileToVFS("Prompt-Regular.ttf", fontPrompt);
			// doc.addFont("Prompt-Regular.ttf", "Prompt", "normal");
	
			helper.printHeader(doc);

			helper.printSectionHeader(doc, "Terms and Condition", 42.5);

			doc.setFont("Sarabun", "normal");
			doc.setFontSize(12);

			let msg = "";
			msg = "The company represents and warrants that information provided hereunder is rightfully provided on behalf of the company and it is accurate and true at the time of the registration.";
			helper.printOrderList(doc, "1.", msg, 50);

			msg = "Thai Oil Public Company Limited reserves the right, at its sole discretion, to cancel or terminate the counterparty registration if it finds the company is disqualified for the registration or the information provided is false or fraud, provided that such cancellation of the registration shall not affect the rights and obligations of the partners under any existing transactions.";
			helper.printOrderList(doc, "2.", msg, 60 + 2);
			
			msg = "Additional information may be requested upon review.";
			helper.printOrderList(doc, "3.", msg, 75 + 4);

			msg = "Thaioil and Subsidiaries are committed to respecting human rights principles are declared in the international Bill of Human Rights in all business activities across our value chain.";
			helper.printOrderList(doc, "4.", msg, 80 + 6);

			msg = "We will take necessary actions to ensure that our employees, activities, products or services and business partners do not contribute to adverse human rights impacts. To that end, we have implemented a human rights due diligence process in line with the United Nations Guiding Principles on Business and Human Rights. Thai Oil's Business partners must follow international human rights standards. They should comply with the Policy and also extend these expectations to their business partners.";
			// msg = "กลุ่มไทยออยล์มีความมุ่งมั่นต่อการเคารพหลักสิทธิมนุษย์ชนตามที่ระบุในกฎบัตรระหว่างประเทศว่าด้วยสิทธิมนุษยชนในทุกการดำเนินธุรกิจตลอดห่วงโซ่คุณค่า กลุ่มไทยออยล์จะดำเนินการที่จำเป็นเพื่อให้มั่นใจว่าพนักงาน กิจกรรม ผลิตภัณฑ์ หรือบริการ ตลอดจนคู่ค้าจะหลีกเลี่ยงการเข้าไปมีส่วนเกี่ยวข้องกับการละเมิดสิทธิมนุยชน";
			helper.printParagraph(doc, msg, 92.5 + 6);

			helper.printSectionHeader(doc, "Company Information", 120);
			helper.printSectionHeader(doc, "List of Shareholders who hold an interest in the company more than 10%", 160);
			helper.printSectionHeader(doc, "Registered Address", 180);

			doc.addPage();
			helper.printHeader(doc);
			helper.printSectionHeader(doc, "Mailing Address", 42.5);
			helper.printSectionHeader(doc, "Contact Person Information", 60);
			helper.printSectionHeader(doc, "Product of Interested", 80);
			helper.printSectionHeader(doc, "Destination Country", 100);
			
			doc.addPage();
			helper.printHeader(doc);
			helper.printSectionHeader(doc, "Additional Information", 42.5);
			helper.printSectionHeader(doc, "ESG and Compliance", 60);

			// You can save or display the PDF using JavaScript here
			doc.save("Disclaimer.pdf");

			const dismissActionPanel = $A.get("e.force:closeQuickAction");
        	dismissActionPanel.fire();
		} catch(ex) {
			console.error(ex);
		}
	}
})